          alter:
            alter_text: true
            text: "<div class=\"measerModal\">\r\n      <a class=\"measerBtn\" href=\"#popup{{ nid }}\">Open</a>\r\n    </div>\r\n\r\n    <div id=\"popup{{ nid }}\" class=\"measerOverlay\">\r\n      <div class=\"measerPopup\">\r\n        <h2>Here i am</h2>\r\n        <a class=\"measurClose\" href=\"#\">&times;</a>\r\n        <div class=\"measurContent\">\r\n\r\n<div class=\"invboxgrid\">\r\n      <div class=\"div1\"><h1>ایمپریل ٹیلرزاینڈ کلاتھ ھاوس</h1></div>\r\n      <div class=\"div2\">\r\n        <h4>المدینہ مارکیٹ، چارسدہ بس سٹینڈ، پشاور۔ موبایل 03469153212</h4>\r\n      </div>\r\n      <div class=\"div3\">\r\n        <em>ناپ نمبر:</em>\r\n        <b>{{ nid }}</b>\r\n        <hr />\r\n      </div>\r\n      <div class=\"div4\">\r\n        <em>تاریخ آمد:</em>\r\n        <hr />\r\n      </div>\r\n      <div class=\"div5\">\r\n        <em>کسٹمر نام: </em>\r\n        <b>{{ field_customer }}</b>\r\n        <hr />\r\n      </div>\r\n      <div class=\"div6\">\r\n        <em>تاریخ واپسی:</em>\r\n        <hr />\r\n      </div>\r\n      <div class=\"div7\">\r\n        <em>استاد کا نام:</em>\r\n        <hr />\r\n      </div>\r\n      <div class=\"div8\">\r\n        <em>کٹر کا نام:</em>\r\n        <hr />\r\n      </div>\r\n<div class=\"div9\">\r\n        <div class=\"subgrid1\">\r\n          <div class=\"subdiv1\"><em>لمبائی</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_lambai }}</p></div>\r\n          <div class=\"subdiv1\"><em>بازو</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_bazo_lambai }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>تیرہ</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_teera }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>کالر</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_kalar }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>چھاتی</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_chatee }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>کمر</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_kamar }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>گھیرا</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_gera }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>شلوار لمبائی</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_shalwar_l }}</p></div>\r\n\r\n          <div class=\"subdiv1\"><em>پاینچا</em></div>\r\n          <div class=\"subdiv1\"><p>{{ field_painch }}</p></div>\r\n\r\n        </div>\r\n      </div>\r\n      \r\n    </div>\r\n         \r\n\r\n        </div>\r\n      </div>\r\n    </div>"
